import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and fill with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button
    await page.click('.search-btn:visible');
    await page.waitForTimeout(1000); // Brief wait for search to process

    // Wait for search results to load
    await page.waitForSelector('.products-grid, .products-list, .search-results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = {};
    const resultsCount = await page.$eval('.results-count', el => el.textContent.trim()).catch(() => 'N/A');
    extractedData.resultsCount = resultsCount;

    // Get product titles from search results
    const productTitles = await page.$$eval('.product-title', titles => 
      titles.slice(0, 5).map(title => title.textContent.trim())
    ).catch(() => []);
    extractedData.productTitles = productTitles;

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
